function Product(props) {
  const {id, productName, price, ProductImage} =props.data
  return (
    <div class="card" style={{width: '18rem'}}>
    <img src={ProductImage} class="card-img-top" alt="..."/>
    <div class="card-body">
      <p class="card-text">
        
        {productName}
        ${price}

      </p>
    </div>
  </div>
      
    
  )
}

export default Product
